History Documentary hosted by Peter Offer, published by National Geographic in 2011 - English narration


Information
------------------------------

Columbus' Cursed Colony
It's the spot in the Caribbean where the Old World first met the New. In Columbus' Cursed Colony join two scientific expeditions on a journey that takes you beneath the waters of La Isabela Bay in Dominican Republic to search for the lost fleet of Christopher Columbus. Then meet the team on land to decode clues in hi-tech labs and discover the secrets locked in European snails!
Join the search for the lost fleet of Columbus, decoding clues in labs and 15th-century cemeteries

